package org.tnsindia.operator;

public class UranyOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int a=5,b=3;
		int x=a++; //5 Preincrement ++a
		int y=++b; //4 postincrement a++
		int z=a+x; //6+5=11
		//Preincrement --a
		//postincrement a--
		
		System.out.println(z);
	}

}
